CREATE TABLE IF NOT EXISTS PLT_OGNZ_RGN
(
	DEPT_ID              BIGINT NOT NULL ,
	CUSTCO_ID            BIGINT NOT NULL ,
	RGN_CD               VARCHAR(5) NOT NULL ,
	RGTR_ID              BIGINT NOT NULL ,
	REG_DT               VARCHAR(14) NOT NULL ,
	MDFR_ID              BIGINT NULL ,
	MDFCN_DT             VARCHAR(14) NULL 
);

CREATE UNIQUE INDEX IF NOT EXISTS PLT_OGNZ_RGN_PK ON PLT_OGNZ_RGN
(DEPT_ID   ASC,CUSTCO_ID   ASC,RGN_CD   ASC);


ALTER TABLE PLT_OGNZ_RGN DROP CONSTRAINT IF EXISTS plt_ognz_rgn_pkey;

ALTER TABLE PLT_OGNZ_RGN
	ADD PRIMARY KEY (DEPT_ID,CUSTCO_ID,RGN_CD);


CREATE INDEX IF NOT EXISTS PLT_OGNZ_RGN_F1 ON PLT_OGNZ_RGN
(DEPT_ID   ASC,CUSTCO_ID   ASC);

CREATE INDEX IF NOT EXISTS PLT_OGNZ_RGN_F2 ON PLT_OGNZ_RGN
(RGN_CD   ASC);

CREATE TABLE IF NOT EXISTS PLT_RGN
(
	RGN_CD               VARCHAR(5) NOT NULL ,
	UP_RGN_CD            VARCHAR(5) NULL ,
	RGN_NM               VARCHAR(80) NULL ,
	RGN_DTL_NM           VARCHAR(80) NULL ,
	EXPSR_YN             CHAR(1) NULL ,
	SORT_ORD             INT NULL 
);

CREATE UNIQUE INDEX IF NOT EXISTS PLT_RGN_PK ON PLT_RGN
(RGN_CD   ASC);


ALTER TABLE PLT_RGN DROP CONSTRAINT IF EXISTS plt_rgn_pkey;

ALTER TABLE PLT_RGN
	ADD PRIMARY KEY (RGN_CD);

CREATE INDEX IF NOT EXISTS PLT_RGN_F1 ON PLT_RGN
(UP_RGN_CD   ASC);

CREATE TABLE IF NOT EXISTS PLT_RGN_ZONE
(
	RGN_ZONE_CD          VARCHAR(5) NOT NULL ,
	RGN_CD               VARCHAR(5) NOT NULL 
);

CREATE UNIQUE INDEX IF NOT EXISTS PLT_RGN_ZONE_PK ON PLT_RGN_ZONE
(RGN_CD   ASC,RGN_ZONE_CD   ASC);


ALTER TABLE PLT_RGN_ZONE DROP CONSTRAINT IF EXISTS plt_rgn_zone_pkey;

ALTER TABLE PLT_RGN_ZONE
	ADD PRIMARY KEY (RGN_CD,RGN_ZONE_CD);

CREATE INDEX IF NOT EXISTS PLT_RGN_ZONE_F1 ON PLT_RGN_ZONE
(RGN_CD   ASC);

ALTER TABLE PLT_OGNZ_RGN DROP CONSTRAINT IF EXISTS R_OGNZ_RGN_2__OGNZ_87;

ALTER TABLE PLT_OGNZ_RGN
	ADD CONSTRAINT R_OGNZ_RGN_2__OGNZ_87 FOREIGN KEY (DEPT_ID, CUSTCO_ID) REFERENCES PLT_OGNZ (DEPT_ID, CUSTCO_ID);

ALTER TABLE PLT_OGNZ_RGN DROP CONSTRAINT IF EXISTS R_OGNZ_RGN_2__RGN_a3;

ALTER TABLE PLT_OGNZ_RGN
	ADD CONSTRAINT R_OGNZ_RGN_2__RGN_a3 FOREIGN KEY (RGN_CD) REFERENCES PLT_RGN (RGN_CD);

ALTER TABLE PLT_RGN DROP CONSTRAINT IF EXISTS R_RGN_2__RGN_27;

ALTER TABLE PLT_RGN
	ADD CONSTRAINT R_RGN_2__RGN_27 FOREIGN KEY (UP_RGN_CD) REFERENCES PLT_RGN (RGN_CD);

ALTER TABLE PLT_RGN_ZONE DROP CONSTRAINT IF EXISTS R_RGN_ZONE_2__RGN_e0;

ALTER TABLE PLT_RGN_ZONE
	ADD CONSTRAINT R_RGN_ZONE_2__RGN_e0 FOREIGN KEY (RGN_CD) REFERENCES PLT_RGN (RGN_CD);

COMMENT ON TABLE PLT_OGNZ_RGN IS '조직_지역';
COMMENT ON COLUMN PLT_OGNZ_RGN.DEPT_ID IS '부서_ID';
COMMENT ON COLUMN PLT_OGNZ_RGN.CUSTCO_ID IS '고객사_ID';
COMMENT ON COLUMN PLT_OGNZ_RGN.RGN_CD IS '지역_코드';
COMMENT ON COLUMN PLT_OGNZ_RGN.RGTR_ID IS '등록자_ID';
COMMENT ON COLUMN PLT_OGNZ_RGN.REG_DT IS '등록_일시';
COMMENT ON COLUMN PLT_OGNZ_RGN.MDFR_ID IS '수정자_ID';
COMMENT ON COLUMN PLT_OGNZ_RGN.MDFCN_DT IS '수정_일시';

COMMENT ON TABLE PLT_RGN IS '지역';
COMMENT ON COLUMN PLT_RGN.RGN_CD IS '지역_코드';
COMMENT ON COLUMN PLT_RGN.UP_RGN_CD IS '상위_지역_코드';
COMMENT ON COLUMN PLT_RGN.RGN_NM IS '지역_명';
COMMENT ON COLUMN PLT_RGN.SORT_ORD IS '정렬_순서';
COMMENT ON COLUMN PLT_RGN.RGN_DTL_NM IS '지역_상세_명';
COMMENT ON COLUMN PLT_RGN.EXPSR_YN IS '노출_여부';

COMMENT ON TABLE PLT_RGN_ZONE IS '지역_구역';
COMMENT ON COLUMN PLT_RGN_ZONE.RGN_CD IS '지역_코드';
COMMENT ON COLUMN PLT_RGN_ZONE.RGN_ZONE_CD IS '지역_구역_코드';












